 * Parses a given byte array and transforms into a LedgerConfig object
 *
 * @param array byte array to parse
 * @return LedgerConfig
 * @throws IOException if the given byte[] cannot be parsed
 */
static LedgerMetadata parseConfig(byte[] bytes) throws IOException {

  LedgerMetadata lc = new LedgerMetadata();
  String config = new String(bytes);

  if (LOG.isDebugEnabled()) {
    LOG.debug("Parsing Config: " + config);
  }

  String lines[] = config.split(lSplitter);

  if (lines.length < 2) {
    throw new IOException("Quorum size or ensemble size absent from config: " + config);
  }

  try {
    lc.quorumSize = new Integer(lines[0]);
    lc.ensembleSize = new Integer(lines[1]);

    for (int i = 2; i < lines.length; i++) {
      String parts[] = lines[i].split(tSplitter);

      if (parts[1].equals(closed)) {
        lc.close = new Long(parts[0]);
        break;
      }

      ArrayList<InetSocketAddress> addrs = new ArrayList<InetSocketAddress>();
      for (int j = 1; j < parts.length; j++) {
        addrs.add(StringUtils.parseAddr(parts[j]));
      }
      lc.addEnsemble(new Long(parts[0]), addrs);
    }
  } catch (NumberFormatException e) {
    throw new IOException(e);
  }
  return lc;
}

public static JType buildSetValueExpression(
    SourcePrinter out,
    JClassType dtoType,
    String propertyPath,
    String objectVariable,
    String value)
    throws NoSuchFieldException {
  if (StringUtils.isEmpty(propertyPath)) {
    throw new NoSuchFieldException(propertyPath);
  }
  String[] props;
  if (propertyPath.contains(".")) {
    props = propertyPath.split("\\.");
  } else {
    props = new String[] {propertyPath};
  }

  if (props != null && props.length > 0) {
    StringBuilder getExpression = new StringBuilder();
    getExpression.append(objectVariable);
    JType baseType = dtoType;
    JClassType baseClassType = baseType.isClassOrInterface();
    for (int i = 0; i < props.length - 1; i++) {
      if (baseClassType == null && i < props.length - 1) {
        throw new NoSuchFieldException(propertyPath);
      }
      String prop = props[i];
      JClassType propertyType = getTypeForProperty(prop, baseClassType).isClassOrInterface();

      String getterMethod = getGetterMethod(prop, baseClassType);
      String setterMethod = getSetterMethod(prop, baseClassType, propertyType);

      out.println("if (" + getExpression.toString() + "." + getterMethod + "()==null){");
      out.println(
          getExpression
              + "."
              + setterMethod
              + "(("
              + propertyType.getParameterizedQualifiedSourceName()
              + ")"
              + GWT.class.getCanonicalName()
              + ".create("
              + propertyType.getQualifiedSourceName()
              + ".class));");
      out.println("}");
      getExpression.append("." + getterMethod + "()");

      baseClassType = propertyType;
    }
    String prop = props[props.length - 1];
    JType propertyType = getTypeForProperty(prop, baseClassType);
    String setterMethod = getSetterMethod(prop, baseClassType, propertyType);
    out.println(getExpression + "." + setterMethod + "(" + value + ");");

    return propertyType;
  } else {
    throw new NoSuchFieldException(propertyPath);
  }
}

public Integer getValueFromString(String input) {
  checkNotNull(input);
  String[] values = input.split("\\|");
  int ofTheJedi = 0;
  for (String value : values) {
    Matcher matcher = magicConstantsValue.matcher(value);
    if (matcher.matches()) {
      Integer matchedMagicConstantValue = magicConstants.get(matcher.group(1));
      if (matchedMagicConstantValue == null)
        throw new TransformerException("Magic constant does not exist - " + matcher.group(1));
      ofTheJedi |= matchedMagicConstantValue;
    } else ofTheJedi |= Integer.parseInt(value);
  }
  return ofTheJedi;
}

