/**
 * Return all remote addresses that were involved in the passed request.
 *
 * @param request request
 * @return remote addresses
 */
public static List<String> getRemoteAddresses(HttpServletRequest request) {
  List<String> addresses = new ArrayList<String>();
  addresses.add(request.getRemoteHost());
  if (!request.getRemoteAddr().equals(request.getRemoteHost())) {
    // Store both remote host and remote address
    addresses.add(request.getRemoteAddr());
  }
  final String forwardedFor = request.getHeader("X-Forwarded-For");
  if (forwardedFor != null) {
    // Also store address this request was forwarded for.
    final String[] parts = forwardedFor.split(",");
    for (String part : parts) {
      addresses.add(part);
    }
  }
  final String httpVia = request.getHeader("Via");
  if (httpVia != null) {
    // Also store address this request was forwarded for.
    final String[] parts = httpVia.split(",");
    for (String part : parts) {
      addresses.add(part);
    }
  }
  return Collections.unmodifiableList(addresses);
}

/**
 * clean a match title String The assumption are naive. The first assumption is , if a "?" was
 * found it is also the end of a title The second assumption use the keyword "vol.", which doesn't
 * belongs to a title The third assumption use the word length by splitting the title by "," All
 * words, which occur between "," should have a word length more than 4
 *
 * @param title
 * @return cleaned title
 */
private String cleanTitle(String title) {
  String cleanTitle = title;
  int sepIndex = title.lastIndexOf("?");
  if (sepIndex != -1) {
    cleanTitle = title.substring(0, sepIndex + 1);
  } else {
    int end = (title.length() > 4) ? title.length() - 4 : 0;
    sepIndex = title.lastIndexOf("vol.", end);
    if (sepIndex != -1) {
      cleanTitle = title.substring(0, end);
    } else {
      String[] titleParts = title.split(",");
      if (titleParts.length > 0) {
        String[] words = titleParts[0].split("\\s+");
        if (words.length > 4) {
          cleanTitle = titleParts[0];
        }
      }
    }
  }

  return cleanTitle;
}

