public static String getCurrentChatting(String url) {
  if (StringUtils.isEmpty(url)) return url;
  URI uri;
  try {
    uri = new URI(url);
  } catch (URISyntaxException e) {
    e.printStackTrace();
    return null;
  }
  String query = uri.getQuery();
  if (null == query) return null;

  String[] params = query.split("&");
  if (params.length > 0) {
    for (String param : params) {
      if (param.contains(Constants.KEY_CHATTING)) {
        String[] s = param.split("=");
        if (s.length > 1) {
          return s[1];
        }
      }
    }
  } else {
    Logger.d(TAG, "No query param.");
  }

  return null;
}

/**
 * Sanitizes a network status and writes it to disk. Processes every r line separately and looks
 * up whether the descriptor mapping contains a bridge with given identity hash and descriptor
 * publication time.
 */
public void sanitizeAndStoreNetworkStatus(byte[] data, String publicationTime) {

  /* Parse the given network status line by line. */
  StringBuilder scrubbed = new StringBuilder();
  try {
    BufferedReader br = new BufferedReader(new StringReader(new String(data, "US-ASCII")));
    String line = null;
    while ((line = br.readLine()) != null) {

      /* r lines contain sensitive information that needs to be removed
       * or replaced. */
      if (line.startsWith("r ")) {

        /* Parse the relevant parts of this r line. */
        String[] parts = line.split(" ");
        String bridgeIdentity = parts[2];
        String descPublicationTime = parts[4] + " " + parts[5];
        String orPort = parts[7];
        String dirPort = parts[8];

        /* Look up the descriptor in the descriptor mapping, or add a
         * new mapping entry if there is none. */
        String hashedBridgeIdentityHex =
            Hex.encodeHexString(DigestUtils.sha(Base64.decodeBase64(bridgeIdentity + "==")))
                .toLowerCase();
        String mappingKey = hashedBridgeIdentityHex + "," + descPublicationTime;
        DescriptorMapping mapping = null;
        if (this.bridgeDescriptorMappings.containsKey(mappingKey)) {
          mapping = this.bridgeDescriptorMappings.get(mappingKey);
        } else {
          mapping =
              new DescriptorMapping(hashedBridgeIdentityHex.toLowerCase(), descPublicationTime);
          this.bridgeDescriptorMappings.put(mappingKey, mapping);
        }

        /* Write scrubbed r line to buffer. */
        String hashedBridgeIdentityBase64 =
            Base64.encodeBase64String(DigestUtils.sha(Base64.decodeBase64(bridgeIdentity + "==")))
                .substring(0, 27);
        String sdi =
            Base64.encodeBase64String(
                    Hex.decodeHex(mapping.serverDescriptorIdentifier.toCharArray()))
                .substring(0, 27);
        scrubbed.append(
            "r Unnamed "
                + hashedBridgeIdentityBase64
                + " "
                + sdi
                + " "
                + descPublicationTime
                + " 127.0.0.1 "
                + orPort
                + " "
                + dirPort
                + "\n");

        /* Nothing special about s lines; just copy them. */
      } else if (line.startsWith("s ")) {
        scrubbed.append(line + "\n");

        /* There should be nothing else but r and s lines in the network
         * status. If there is, we should probably learn before writing
         * anything to the sanitized descriptors. */
      } else {
        this.logger.fine(
            "Unknown line '" + line + "' in bridge " + "network status. Not writing to disk!");
        return;
      }
    }
    br.close();

  } catch (IOException e) {
    this.logger.log(Level.WARNING, "Could not parse bridge network " + "status.", e);
    return;
  } catch (DecoderException e) {
    this.logger.log(Level.WARNING, "Could not parse bridge network " + "status.", e);
    return;
  }

  /* Write the sanitized network status to disk. */
  try {

    /* Determine file name. */
    String syear = publicationTime.substring(0, 4);
    String smonth = publicationTime.substring(5, 7);
    String sday = publicationTime.substring(8, 10);
    String stime =
        publicationTime.substring(11, 13)
            + publicationTime.substring(14, 16)
            + publicationTime.substring(17, 19);
    File statusFile =
        new File(
            this.sanitizedBridgesDir
                + "/"
                + syear
                + "/"
                + smonth
                + "/statuses/"
                + sday
                + "/"
                + syear
                + smonth
                + sday
                + "-"
                + stime
                + "-"
                + "4A0CCD2DDC7995083D73F5D667100C8A5831F16D");

    /* Create all parent directories to write this network status. */
    statusFile.getParentFile().mkdirs();

    /* Write sanitized network status to disk. */
    BufferedWriter bw = new BufferedWriter(new FileWriter(statusFile));
    bw.write(scrubbed.toString());
    bw.close();

  } catch (IOException e) {
    this.logger.log(
        Level.WARNING, "Could not write sanitized bridge " + "network status to disk.", e);
    return;
  }
}

private static int stringToIpAddr(String addrString) throws UnknownHostException {
  try {
    String[] parts = addrString.split("\\.");
    if (parts.length != 4) {
      throw new UnknownHostException(addrString);
    }

    int a = Integer.parseInt(parts[0]);
    int b = Integer.parseInt(parts[1]) << 8;
    int c = Integer.parseInt(parts[2]) << 16;
    int d = Integer.parseInt(parts[3]) << 24;

    return a | b | c | d;
  } catch (NumberFormatException ex) {
    throw new UnknownHostException(addrString);
  }
}

/**
 * Return the Simple HTTP Resource Path for an absolute http/https URL.
 *
 * <p>The Simple HTTP Resource Path maps an HTTP or HTTPS URL to a path on the classpath or
 * relative to some other root. To form the Simple HTTP Resource Path from an http/https URL:
 *
 * <ol>
 *   <li>Protocol, port, fragment, and query are ignored.
 *   <li>Take the host name, split it into its components, reverse their order, prepend a forward
 *       slash to each, and concatenate them.
 *   <li>Append the path component of the URL.
 * </ol>
 *
 * For example <code>http://schemas.example.org/exampleml/exml.xsd</code> becomes <code>
 * /org/example/schemas/exampleml/exml.xsd</code> .
 *
 * <p>The Simple HTTP Resource Path always starts with a forward slash (if not null). Does not
 * include query components in the path.
 *
 * @param location not null
 * @param keepQuery indicates whether or not the query components should be included in the path.
 *     If this is set to true then the query portion is converted to an MD5 message digest and
 *     that string is used to identify the file in the cache.
 * @return the Simple HTTP Resource Path as a string, or null if the URI is not an absolute
 *     HTTP/HTTPS URL.
 */
public static String getSimpleHttpResourcePath(URI location, boolean keepQuery) {
  String scheme = location.getScheme();
  if (scheme == null || !(scheme.equals("http") || scheme.equals("https"))) {
    return null;
  } else {
    String host = location.getHost();
    String path = location.getPath();
    String[] hostParts = host.split("\\.");
    StringBuilder builder = new StringBuilder();
    for (int i = hostParts.length - 1; i >= 0; i--) {
      builder.append("/");
      builder.append(hostParts[i]);
    }
    builder.append(path);
    String query = location.getQuery();
    if (keepQuery && query != null) {
      builder.append(".");
      builder.append(stringToMD5String(query));
      builder.append(".xsd");
    }
    return builder.toString();
  }
}

