@Override
public Object getConvertedValue(
    FacesContext context, UIComponent component, Object submittedValue)
    throws ConverterException {
  String coords = (String) submittedValue;
  if (isValueBlank(coords)) {
    return null;
  }

  ImageCropper cropper = (ImageCropper) component;

  // remove query string
  String imagePath = cropper.getImage();
  int queryStringIndex = imagePath.indexOf("?");
  if (queryStringIndex != -1) {
    imagePath = imagePath.substring(0, queryStringIndex);
  }

  String[] cropCoords = coords.split("_");
  String format = getFormat(imagePath);

  int x = Integer.parseInt(cropCoords[0]);
  int y = Integer.parseInt(cropCoords[1]);
  int w = Integer.parseInt(cropCoords[2]);
  int h = Integer.parseInt(cropCoords[3]);

  try {
    BufferedImage outputImage = getSourceImage(context, imagePath);
    BufferedImage cropped = outputImage.getSubimage(x, y, w, h);

    ByteArrayOutputStream croppedOutImage = new ByteArrayOutputStream();
    ImageIO.write(cropped, format, croppedOutImage);

    return new CroppedImage(cropper.getImage(), croppedOutImage.toByteArray(), x, y, w, h);

  } catch (IOException e) {
    throw new ConverterException(e);
  }
}

public Dataset fetchVisibleDatasetFromCache(String fileName, int period, int end)
    throws IOException {
  String folder = FileUtils.cacheDatasetsFolder();
  File file = FileUtils.hashedCacheFile(folder, fileName);

  Properties properties = new Properties();
  FileInputStream fileInputStream = new FileInputStream(file);
  properties.load(fileInputStream);

  List<DataItem> items = new ArrayList<DataItem>();
  int size = properties.size();
  for (int i = 0; i < period; i++) {
    int j = end - period + i;
    if (j < size && j >= 0) {
      String key = Integer.toString(j);
      String property = properties.getProperty(key);
      if (property.equals("null")) {
        items.add(null);
      } else {
        String[] values = property.split(",");
        DataItem item =
            new DataItem(
                Long.parseLong(values[0]),
                Double.parseDouble(values[1]),
                Double.parseDouble(values[2]),
                Double.parseDouble(values[3]),
                Double.parseDouble(values[4]),
                Double.parseDouble(values[5]));
        items.add(item);
      }
    }
  }

  fileInputStream.close();
  Dataset dataset = new Dataset(items);
  return dataset;
}

/**
 * Load tileset from file. This will combine the tilesets if one has already been loaded. The most
 * recently loaded tileset file becomes the "loadedFrom" tileset.
 */
public void loadTileset(File from) throws FileNotFoundException, IOException {
  BufferedReader r;
  String line;
  String tokens[];
  int id;
  int lineCount;
  File tileFile;

  if (tiles.size() > 0) {
    isUnsaved = true;
  } else {
    isUnsaved = false;
  }

  System.out.println(from);
  baseDirectory = from.getParentFile();
  this.loadedFrom = from;

  lineCount = 0;
  r = new BufferedReader(new FileReader(from));
  while (true) {
    line = r.readLine();
    lineCount++;

    // stop when no more lines
    if (line == null) break;
    line = line.trim();
    if (line.length() == 0 || line.charAt(0) == COMMENT) {
      continue; // skip comments and empty lines.
    }

    tokens = line.split(DELIM);
    if (tokens.length < 4) {
      System.err.println("Could not parse line " + lineCount + ". :");
      System.err.println(line);
      System.err.println("(There are not enough tokens)");
      continue;
    }
    try {
      id = Integer.parseInt(tokens[ID].trim());
    } catch (Exception e) {
      System.err.println("Could not parse line " + lineCount + ". :");
      System.err.println(line);
      System.err.println("(The tile id is not a valid number)");
      continue;
    }

    // get file for image
    tokens[PATH] = tokens[PATH].trim();
    tokens[NAME] = tokens[NAME].trim();
    tokens[TYPE] = tokens[TYPE].trim();

    tileFile = new File(baseDirectory, tokens[PATH]);
    // System.out.println("load tile image: "+tileFile);
    if (!tileFile.exists()) {
      tileFile = new File(tokens[PATH]);
      if (tileFile.exists()) {
        System.err.println(
            "WARNING: file " + tokens[PATH] + " not within the tilemaps working directory");
      } else {
        r.close();
        throw new FileNotFoundException(
            "File "
                + tokens[PATH]
                + " referenced on line "
                + lineCount
                + " of "
                + from
                + " could not be found");
      }
    }

    // System.out.println("New tile: "+id+", name = "+tokens[NAME]);

    Tile t = null;

    if (tokens.length > EXTRA) {
      t =
          new Tile(
              id,
              tileFile.toString(),
              tokens[NAME].trim(),
              tokens[TYPE].trim(),
              tokens[EXTRA].trim());
    } else {
      t = new Tile(id, tileFile.toString(), tokens[NAME], tokens[TYPE]);
    }
    tiles.add(t);
  }
} // end loadTileset

