/**
 * Returns a new conditional evaluate-able node.
 *
 * @param condition The string to be parsed when creating the branch.
 * @throws IllegalArgumentException If a condition is malformed.
 * @throws NoSuchFieldException If a specified condition parameter does not exist.
 */
public static Condition getCondition(String condition)
    throws IllegalArgumentException, NoSuchFieldException {
  // split disjuncts (or statements) denoted by | characters
  String[] juncts = condition.split("\\|");
  if (juncts.length > 1) {
    // if multiple disjuncts exist, create a container for them.
    return new DisjunctiveConditions(juncts);
  }
  return parseFromConjuncts(condition);
}

private GtfsTrip produce(
    VehicleJourney vj, String timetableId, List<GtfsStopTime> times, boolean multipleTimetable) {

  GtfsTrip trip = new GtfsTrip();

  String tripId = toGtfsId(vj.getObjectId());
  if (multipleTimetable) tripId += "_" + timetableId.split(":")[2];

  trip.setTripId(tripId);

  // route = un aller-retour !
  Route route = vj.getRoute();
  if ("R".equals(route.getWayBack()) && route.getWayBackRouteId() != null) {
    logger.info("trip " + vj.getObjectId() + " as wayback of route " + route.getWayBackRouteId());
    trip.setRouteId(toGtfsId(route.getWayBackRouteId()));
    trip.setDirectionId(GtfsTrip.INBOUND);
  } else {
    logger.info("trip " + vj.getObjectId() + " as direct of route " + route.getWayBackRouteId());

    trip.setRouteId(toGtfsId(route.getObjectId()));
    trip.setDirectionId(GtfsTrip.OUTBOUND);
  }

  trip.setServiceId(toGtfsId(timetableId));

  // trip.setTripHeadsign(...);
  String name = vj.getPublishedJourneyName();
  if (name == null && vj.getNumber() != null) name = "" + vj.getNumber();
  else name = "";
  if (name.trim().length() == 0 && vj.getComment() != null) name = vj.getComment();
  if (name.trim().length() != 0) trip.setTripShortName(name);
  // trip.setShapeId(...);

  // add StopTimes
  for (GtfsStopTime time : times) {
    GtfsStopTime copy = time.copy();
    copy.setTripId(tripId);
    trip.addStopTime(copy);
  }

  return trip;
}

