/**
 * Parses a time string. The expected format is <tt>[[H:]MM:]SS</tt>.
 *
 * @return The time in milliseconds or -1, if the time string is not valid.
 */
public static long parseTimeString(String s) {
  String a[] = s.split(":");
  if (a.length == 0 || a.length > 3) return -1;
  int hours = 0;
  int minutes = 0;
  int seconds = 0;
  try {
    if (a.length == 3) {
      hours = Integer.parseInt(a[0]);
      minutes = Integer.parseInt(a[1]);
      seconds = Integer.parseInt(a[2]);
    } else if (a.length == 2) {
      minutes = Integer.parseInt(a[0]);
      seconds = Integer.parseInt(a[1]);
    } else {
      assert a.length == 1;
      seconds = Integer.parseInt(a[0]);
    }
  } catch (NumberFormatException e) {
    return -1;
  }
  if (minutes < 0 || minutes > 60 || seconds < 0 || seconds > 60) return -1;
  return 1000L * (seconds + minutes * 60L + hours * 3600L);
}

/**
 * Get the list of User objects who are eligible to receive the notification email.
 *
 * @param event The event that matched criteria to cause the notification.
 * @return the list of User objects who are eligible to receive the notification email.
 */
protected List getRecipients(Event event) {
  List recipients = new ArrayList();

  String resourceRef = event.getResource();
  Reference ref = EntityManager.newReference(resourceRef);

  ResourceProperties props = ref.getProperties();
  String modifiedBy = props.getProperty(ResourceProperties.PROP_MODIFIED_BY);

  String parts[] = resourceRef.split("/");
  if (parts.length >= 4) {
    String dropboxOwnerId = parts[4];
    if (modifiedBy != null && modifiedBy.equals(dropboxOwnerId)) {
      // notify instructor(s)
      StringBuilder buf = new StringBuilder();
      buf.append("/content/group-user/");
      buf.append(parts[3]);
      buf.append("/");
      String siteDropbox = buf.toString();

      recipients.addAll(
          SecurityService.unlockUsers(ContentHostingService.AUTH_DROPBOX_MAINTAIN, siteDropbox));
    } else {
      // notify student
      try {
        User user = UserDirectoryService.getUser(dropboxOwnerId);
        recipients.add(user);
      } catch (UserNotDefinedException e0) {
        try {
          User user = UserDirectoryService.getUserByEid(dropboxOwnerId);
          recipients.add(user);
        } catch (UserNotDefinedException e1) {
          logger.warn("UserNotDefinedException trying to get user: " + dropboxOwnerId);
        }
      }
    }
  }

  return recipients;
}

