private static String updateUrls(
    String folder, String themeName, boolean inheritedFile, String strLine) {
  // Define image url prefix
  String urlPrefix = "";
  if (inheritedFile) {
    urlPrefix = "../" + themeName + "/";
  }

  if (strLine.indexOf("url(/") > 0) {
    // Do nothing for urls beginning with /
  } else if (strLine.indexOf("url(../") >= 0) {
    // eliminate a path segment in the folder name for every
    // "../"
    String[] folderSegments = folder.split("/");
    int segmentCount = folderSegments.length;
    while (segmentCount > 0 && strLine.indexOf("url(../") >= 0) {
      segmentCount--;
      strLine = strLine.replaceAll("url\\(../", ("url\\("));
    }
    // add remaining path segments to urlPrefix
    StringBuilder sb = new StringBuilder(urlPrefix);
    for (int i = 0; i < segmentCount; i++) {
      sb.append(folderSegments[i]);
      sb.append("/");
    }
    strLine = strLine.replaceAll("url\\(", ("url\\(" + sb.toString()));

  } else {
    strLine = strLine.replaceAll("url\\(", ("url\\(" + urlPrefix + folder + "/"));
  }
  return strLine;
}

/**
 * Construct/initialize a map which allows us to easily look up which sites are in the intervals
 * described by this BED file. If arg is true, strip chr from all contig labels
 *
 * @throws IOException
 */
public void buildIntervalsMap(boolean stripChr) throws IOException {
  BufferedReader reader = new BufferedReader(new FileReader(getAbsolutePath()));
  String line = reader.readLine();
  intervals = new HashMap<String, List<Interval>>();
  while (line != null) {
    if (line.startsWith("#")) {
      line = reader.readLine();
      continue;
    }
    if (line.length() > 0) {
      String[] toks = line.split("\\s");
      String contig = toks[0];
      if (stripChr) contig = contig.replace("chr", "");
      toks[1] = toks[1].trim();
      toks[2] = toks[2].trim();
      try {
        Integer begin = Integer.parseInt(toks[1]) + 1;
        Integer end = Integer.parseInt(toks[2]) + 1;
        Interval interval = new Interval(begin, end);

        List<Interval> contigIntervals = intervals.get(contig);
        if (contigIntervals == null) {
          contigIntervals = new ArrayList<Interval>(1024);
          intervals.put(contig, contigIntervals);
          // System.out.println("BED file adding contig: " + contig);
        }
        contigIntervals.add(interval);
      } catch (Exception ex) {
        Logger.getLogger(Pipeline.primaryLoggerName)
            .warning("Skipping invalid line in bed file: " + line);
      }
    }
    line = reader.readLine();
  }

  reader.close();
  sortAllContigs();
}

