public long getChronoTime(String timeForm) {
  // The chronometer doesn't actually have a 'getTime' function. So here's one
  String[] pieces = timeForm.split(":");

  long t = 0;
  for (int i = pieces.length - 1; i >= 0; i--) {
    try {
      long temp = Long.parseLong(pieces[i]);
      t += temp * (temp == 0 ? 0 : Math.pow(60, pieces.length - i - 1));
    } catch (Exception e) {
      // What did we get
      Log.i("stupidChrono:", pieces[i]);
    }
  }
  return t;
}

public boolean allowSelect(ContentResource resource) {
  // on a new resource, it seems that getContentType is more reliable than accessing that value
  // through properties.
  String mimeType =
      resource
          .getContentType(); // .getProperties().getProperty(ResourceProperties.PROP_CONTENT_TYPE);
  String[] parts = mimeType.split("/");
  String primaryType = parts[0];

  if (!getMimeTypes().isEmpty()
      && !getMimeTypes().contains(primaryType)
      && !getMimeTypes().contains(mimeType)) {
    return false;
  }

  String filePath = resource.getUrl();

  if (getAcceptedExtensions() != null) {
    // check extension
    for (Iterator i = getAcceptedExtensions().iterator(); i.hasNext(); ) {
      if (filePath.endsWith("." + i.next().toString().toLowerCase())) {
        return true;
      }
    }

    return false;
  } else {
    return true;
  }
}

