/**
 * Create a new node. Nodes are of the form nt:folder/nt:folder/nt:folder/nt:file nt:folders have
 * properties nt:files have properties nt:files have a nt:resource subnode
 *
 * @param id
 * @param collection
 * @return
 * @throws TypeException
 */
private Node createNode(String id, String type) throws TypeException {
  Node node = null;
  try {
    String absPath = m_user.convertId2Storage(id);
    Session s = jcrService.getSession();
    Node n = getNodeFromSession(s, absPath);
    // the node might already exist
    if (n != null) {
      return n;
    }

    String vpath = getParentPath(absPath);
    while (n == null && !"/".equals(vpath)) {
      n = getNodeFromSession(s, vpath);
      if (n == null) {
        vpath = getParentPath(vpath);
      } else {
        log.debug("Got Path " + vpath + " as " + n);
      }
    }
    if (n == null) {
      n = s.getRootNode();
    }
    log.debug("VPath is " + vpath);
    String relPath = absPath.substring(vpath.length());
    // Node rootNode = s.getRootNode();
    if (relPath.startsWith("/")) {
      relPath = relPath.substring(1);
    }

    String[] pathElements = relPath.split("/");
    log.debug("RelPath is " + relPath + " split into " + pathElements.length + " elements ");
    for (String pathel : pathElements) {
      log.debug(" Path Element is [" + pathel + "]");
    }

    Node currentNode = n;
    for (int i = 0; i < pathElements.length; i++) {
      try {
        log.debug("Getting " + pathElements[i] + " under " + currentNode);
        currentNode = currentNode.getNode(pathElements[i]);
        if (!currentNode.isNodeType(JCRConstants.NT_FOLDER)
            && !currentNode.isNodeType(JCRConstants.NT_BASE)) {
          throw new TypeException(
              "Cant create collection or a folder inside a node that is not a folder "
                  + currentNode.getPath());
        }

      } catch (PathNotFoundException pnfe) {
        if (log.isDebugEnabled()) log.debug("Not Found " + pnfe.getMessage() + " ");
        if (i < pathElements.length - 1 || JCRConstants.NT_FOLDER.equals(type)) {
          if (log.isDebugEnabled())
            log.debug(
                "Adding Node "
                    + pathElements[i]
                    + " as "
                    + type
                    + " to "
                    + currentNode.getPath());
          Node newNode = currentNode.addNode(pathElements[i], JCRConstants.NT_FOLDER);
          populateFolder(newNode);
          currentNode.save();
          currentNode = newNode;
          if (log.isDebugEnabled()) log.debug("Adding Node Complete");
        } else {
          if (log.isDebugEnabled())
            log.debug(
                "Adding Node "
                    + pathElements[i]
                    + " as "
                    + type
                    + " to "
                    + currentNode.getPath());
          Node newNode = currentNode.addNode(pathElements[i], JCRConstants.NT_FILE);
          populateFile(newNode);
          currentNode.save();
          currentNode = newNode;
          if (log.isDebugEnabled()) log.debug("Adding Node Complete");
        }
      }
      if (currentNode.isCheckedOut()) {
        currentNode.save();
      }
    }
    node = currentNode;
    if (node == null) {
      log.error("Failed to create Node " + absPath + " got " + node);
      throw new Error("Failed to create node " + absPath + " got " + node);
    } else if (!absPath.equals(node.getPath())) {

      log.error("Failed to create Node " + absPath + " got" + node.getPath());
      throw new Error("Failed to create node " + absPath + " got " + node.getPath());
    }

  } catch (RepositoryException rex) {
    log.warn("Unspecified Repository Failiure ", rex);
    log.error("Unspecified Repository Failiure " + rex.getMessage());
  }
  return node;
}

/**
 * Renders a ToggleButton and returns it as a BufferedImage. ToggleButton does not wrap unless
 * indicated to do so with \n. Also if two names are used the second name appears at an offset.
 * And since this is a ToggleButton a box and possible check mark in the box are added
 *
 * @param text is the text of the ToggleButton
 * @param text2 is the second text of the toggle button added on a second line and indented
 * @param party is the party of the candidate in the toggle button, right aligned on first line of
 *     button
 * @param fontsize the size of the font
 * @param wrappingWidth is not used
 * @param bold whether the button is bold
 * @param selected is whether or not the toggleButton should have a check mark in its box
 * @return the rendered ToggleButton
 */
public static BufferedImage renderToggleButton(
    String text,
    String text2,
    String party,
    int fontsize,
    int wrappingWidth,
    boolean bold,
    boolean selected,
    boolean focused) {

  /* This is the standard font we use, so we can size the button with respect to the text */
  Font font = new Font(FONT_NAME, (bold) ? Font.BOLD : Font.PLAIN, fontsize);

  /* box character */
  String box = "\u25a1";

  /* check mark character */
  String filledSelection = "\u2713";

  /* This is the image that we will draw the button on to */
  BufferedImage wrappedImage = new BufferedImage(1000, 1000, BufferedImage.TYPE_INT_ARGB);

  /* Get the graphics off our image and set is font and aliasing information */
  Graphics2D graphs = wrappedImage.createGraphics();
  graphs.setRenderingHint(RenderingHints.KEY_ANTIALIASING, RenderingHints.VALUE_ANTIALIAS_ON);
  graphs.setFont(font);

  /* Find the baseline for the text that will be drawn on the button */
  int baseline = graphs.getFontMetrics().getAscent();

  /* This is how much whitespace there will be between the text and the edge of the button */
  int padding = 10;

  /* This is the location of the top side of the bounding box for the text */
  int heightPos = padding + baseline;

  /* The positioning of the check box on every button, right justified */
  int boxPos = wrappingWidth - 30;

  /* The length of the party to be displayed for this button */
  int partyLength = lineWidth(party.split(" "), font);

  /* The position of the party text, right justified next to the checkbox */
  int partyPos = boxPos - 10 - partyLength;

  /* Set and draw the background color if the button is focused */
  if (focused) {
    graphs.setColor(Color.ORANGE);
    graphs.fillRect(0, 0, wrappedImage.getWidth(), wrappedImage.getHeight());
  }

  /* Set the font color to black for drawing text */
  graphs.setColor(Color.BLACK);

  /* Draw the text for the button */
  graphs.drawString(text, padding, heightPos);

  /* Draw the checkbox on the button */
  graphs.drawString(box, boxPos, heightPos);

  /* If the button is selected, fill the checkbox with a green check */
  if (selected) {

    /* Set the check's font */
    Font checkFont =
        new Font(FONT_NAME, Font.PLAIN, (int) (fontsize - 4 + ((fontsize - 4) * 1.1)));
    graphs.setFont(checkFont);

    /* Set the color of the check to green */
    graphs.setColor(new Color(0, 165, 80));

    /* Draw the box and reset the font and draw colors */
    graphs.drawString(filledSelection, boxPos, heightPos);
    graphs.setFont(font);
    graphs.setColor(Color.BLACK);
  }

  /* If there is a party, draw it on */
  if (!party.equals("")) graphs.drawString(party, partyPos, heightPos);

  /* If there is secondary text, i.e. this is a presidential race, draw it */
  if (!text2.equals("")) {
    /* Update the height to account for the second name */
    heightPos += lineHeight(text, font);

    /* Tab over the second candidate's name */
    graphs.drawString(" " + text2, padding, heightPos);
  }

  /* Ensure the font color is black, and then set a thicker stroke to border the button */
  graphs.setColor(Color.BLACK);
  graphs.setStroke(new BasicStroke(padding / 2));

  /* start this rectangle off the top of our visible area so we don't see the top border */
  graphs.drawRect(0, -padding, wrappingWidth - 1, heightPos + 2 * padding - 1);

  /* Wrap the image to the correct size */
  wrappedImage = wrappedImage.getSubimage(0, 0, wrappingWidth, heightPos + padding);

  /* I think this copies to avoid aliasing or something. TODO Figure this out */
  return copy(wrappedImage);
}

/**
 * Builds a list containing integers and ranges of integers, read from a property having the
 * following format: "<tt>{exp}, {exp}, {exp}, ...</tt> ".
 *
 * <p>An expression (<tt>{exp}</tt>) can be:
 *
 * <ul>
 *   <li>A single integer. This value will be added to the returned list.
 *   <li>A range, having the following format: "<tt>{min}-{max}</tt>". All values between the
 *       <tt>{min}</tt> and <tt>{max}</tt> values are inserted in the list.
 * </ul>
 *
 * <p>For example, if the property is equal to "<tt>3, 10-14, 91</tt>", the returned list will
 * contain 7 elements: <tt>[3, 10, 11, 12, 13, 14, 91]</tt>.
 *
 * @param property the property to read as a list of integer expressions
 * @return a list of integers as described above
 * @throws NumberFormatException if integers cannot be read from the property
 */
public static List<Integer> getIntList(String property) {
  List<Integer> integers = new ArrayList<Integer>();

  String[] values = property.split(",");
  for (String value : values) {
    if (value.contains("-")) {
      String[] boundaries = value.split("-");
      int i1 = Integer.parseInt(boundaries[0]);
      int i2 = Integer.parseInt(boundaries[1]);

      // Now add all values between boundaries, including
      int min = Math.min(i1, i2);
      int max = Math.max(i1, i2);
      for (int i = min; i <= max; i++) {
        integers.add(i);
      }
    } else {
      integers.add(Integer.parseInt(value));
    }
  }
  return integers;
}

