/**
 * Load a MD-Sequence database from a file
 *
 * @param path the path of the file
 * @throws IOException exception if error reading the file
 */
public void loadFile(String path) throws IOException {
  // It read the file line by line
  // Each line is a md-sequence except lines starting with #.

  String thisLine;
  BufferedReader myInput = null;
  try {
    FileInputStream fin = new FileInputStream(new File(path));
    myInput = new BufferedReader(new InputStreamReader(fin));
    // for each line until the end of file
    while ((thisLine = myInput.readLine()) != null) {
      // if the line is a comment, is empty or is a
      // kind of metadata
      if (thisLine.isEmpty() == true
          || thisLine.charAt(0) == '#'
          || thisLine.charAt(0) == '%'
          || thisLine.charAt(0) == '@') {
        continue;
      }

      // split the MDsequence into tokens
      // and process this MDsequence
      processMDSequence(thisLine.split(" "));
    }
  } catch (Exception e) {
    e.printStackTrace();
  } finally {
    // close the file
    if (myInput != null) {
      myInput.close();
    }
  }
}

public static List<File> getExports(Session session) {
  String exports = session.get(Application.EXPORTS);
  List<File> archives = new ArrayList<File>();
  if (exports != null) {
    List<String> exportList = new ArrayList(Arrays.asList(exports.split(",")));
    for (Iterator<String> i = exportList.iterator(); i.hasNext(); ) {
      String export = i.next();
      File tmpDir = new File(Properties.getDownloads(), export.split(":")[0]);
      if (tmpDir.exists()) {
        archives.add(
            new File(
                new File(Properties.getExports(), export.split(":")[1].split("-")[0]),
                export.split(":")[1]));
      } else {
        i.remove();
      }
    }
    if (exportList.isEmpty()) {
      session.remove(Application.EXPORTS);
    } else {
      session.put(Application.EXPORTS, StringUtils.join(exportList, ","));
    }
  }
  return archives;
}

private void handleRemoteSchema(Scriptable xhr, String url) {
  url = getId() + '/' + url;
  String tableUrl = url.substring(0, url.lastIndexOf('/'));

  String contentType =
      (String)
          ((Function) xhr.get("getResponseHeader", xhr))
              .call(
                  PersevereContextFactory.getContext(),
                  global,
                  xhr,
                  new Object[] {"Content-Type"});
  String schemaUrl = null;
  if (contentType != null) {
    String[] contentTypeParts = contentType.split(";\\s*");
    contentType = contentTypeParts[0];
    for (String part : contentTypeParts) {
      if (part.startsWith("schema")) {
        schemaUrl = part.split("=")[1];
      }
    }
  }
  if (schemaUrl != null) {
    if (DataSourceManager.getSource(tableUrl) == null && loadingSources.get(tableUrl) == null) {
      loadingSources.put(tableUrl, true);
      Persistable schemaForData =
          (Persistable) Identification.idForRelativeString(url, schemaUrl).getTarget();
      // use a transaction to make the class not really run
      PersistableClass classForData = new PersistableClass();
      classForData.persist = false;
      for (Map.Entry<String, Object> entry : schemaForData.entrySet(0)) {
        classForData.put(entry.getKey(), classForData, entry.getValue());
      }
      try {
        Map config = new HashMap();
        config.put("name", tableUrl);
        config.put("sourceClass", getClass().getName());
        config.put("hidden", true);
        DataSourceManager.initSource(config, null, classForData, "");
      } catch (Exception e) {
        e.printStackTrace();
      }
    }
  }
}

/**
 * Set the configuration that needs to be set on the cache.
 *
 * @param config The unsplit configuration. Eg: "timeToLiveSeconds=400,timeToIdleSeconds=100"
 * @return This object.
 */
public CacheInitializer configure(String config) {
  configMap = new HashMap<String, String>();
  String[] configParts = config.split(",");
  for (String part : configParts) {
    String[] splitParts = part.split("=", 2);
    if (splitParts.length == 2) {
      String key = splitParts[0];
      String value = splitParts[1];
      configMap.put(key, value);
    } else {
      M_log.warn("Couldn't parse cache config of: " + part);
    }
  }
  return this;
}

/**
 * Draw a multiple lines string.
 *
 * @param canvas the canvas to paint to
 * @param text the text to be painted
 * @param x the x value of the area to draw to
 * @param y the y value of the area to draw to
 * @param paint the paint to be used for drawing
 */
protected void drawString(Canvas canvas, String text, float x, float y, Paint paint) {
  String[] lines = text.split("\n");
  Rect rect = new Rect();
  int yOff = 0;
  for (int i = 0; i < lines.length; ++i) {
    canvas.drawText(lines[i], x, y + yOff, paint);
    paint.getTextBounds(lines[i], 0, lines[i].length(), rect);
    yOff = yOff + rect.height() + 5; // space between lines is 5
  }
}

