@SuppressWarnings("unchecked")
private boolean containstool(Site site, String tool) {

  boolean containstool = false;

  String[] toolcheck = tool.split("[|]");

  List<SitePage> pages = (List<SitePage>) site.getOrderedPages();

  for (SitePage page : pages) {
    List<ToolConfiguration> lst = (List<ToolConfiguration>) page.getTools();
    for (ToolConfiguration conf : lst) {
      Tool t = conf.getTool();
      for (String s : toolcheck) {
        if (t != null && t.getId() != null && t.getId().equals(s)) {
          containstool = true;
        }
      }
    }
  }

  return containstool;
}

/**
 * Returns the attribute in camel case form.
 *
 * @return the attribute in camel case form
 */
public String asCamelCase() {

  String source = isReference() ? name.substring(0, name.indexOf(REF)) : name;

  String[] parts = source.split("-");

  if (parts.length == 1) {
    return parts[0];
  }

  StringBuilder builder = new StringBuilder(parts[0]);

  for (int i = 1; i < parts.length; i++) {
    builder.append(StringUtils.capitalize(parts[i]));
  }

  return builder.toString();
}

public void importFromTAB(String ref, Reader tabFileReader) throws UTGBException {

  int entryCount = 0;
  int lineCount = 1;
  try {
    initDB();
    db.update("pragma synchronous = off");
    db.setAutoCommit(false);

    BufferedReader input = new BufferedReader(tabFileReader);
    for (String line; (line = input.readLine()) != null; lineCount++) {
      // skip the comment line
      if (line.startsWith("#")) continue;

      try {
        String[] column = line.split("\t");
        if (column.length < 4) {
          throw new IllegalArgumentException();
        }
        // chr, start, end, text ....
        String chr = column[0];
        int start = Integer.parseInt(column[1]);
        int end = Integer.parseInt(column[2]);
        StringBuilder buf = new StringBuilder();
        for (int i = 3; i < column.length; ++i) {
          if (i != 3) buf.append(" ");
          buf.append(column[i]);
        }
        GenomeKeywordEntry entry = new GenomeKeywordEntry(ref, chr, buf.toString(), start, end);

        if (entryCount > 0 && (entryCount % 10000 == 0))
          _logger.info("num entries: " + entryCount);
        entryCount++;

        add(entry);
      } catch (IllegalArgumentException e) {
        _logger.warn(
            String.format(
                "line %d has invalid format: %s (%s)", lineCount, line, e.getMessage()));
      } catch (DBException e) {
        _logger.error(String.format("line %d: insertion error %s", lineCount, e.getMessage()));
        e.printStackTrace(System.err);
      }
    }

    db.update("commit");
  } catch (DBException e) {
    _logger.error("error at line " + lineCount);
    throw new UTGBException(UTGBErrorCode.DatabaseError, e);
  } catch (IOException e) {
    throw new UTGBException(UTGBErrorCode.IO_ERROR, e);
  }
}

