/**
 * Get the credentials for a specific file, ignoring the global username and password.
 *
 * @param filename
 * @return
 */
public Credentials getCredentials(final String filename) {
  Credentials result = null;

  final String key = getKey(filename);
  if (key == null) {
    return result;
  }

  // Split the line at the . separators,
  final String[] keyArray = key.split("\\.");

  // Check that the third item is "filename", as expected:
  if (keyArray.length == 3 && "filename".equals(keyArray[2])) {
    // Get the username and password for this file:
    final String usernameKey = key.replaceAll(keyArray[2], "username");
    final String passwordKey = key.replaceAll(keyArray[2], "password");
    final String username = getPropertyNonNull(usernameKey).trim();
    final String password = getPropertyNonNull(passwordKey);
    result = new Credentials(null, username, password, null);
  }

  return result;
}

/**
 * Indents the given text over the given range
 *
 * @param text
 * @param startChar
 * @param endChar
 * @return newText
 */
private String indentText(String text, int startChar, int endChar) {
  String[] newText = text.split("\n", -1);
  // Calculate the line numbers to indent
  int startLine = 0;
  int endLine = 0;
  // Get Start Line
  int i = startChar;
  if (i == text.length()) i--;
  while (i > 0) {
    if (text.charAt(i) == '\n') startLine++;
    i--;
  }
  // Get End Line
  i = endChar;
  if (i == text.length()) i--;
  while (i > startChar) {
    if (text.charAt(i) == '\n') endLine++;
    i--;
  }
  endLine += startLine;

  // Get the number of tabs from the previous line
  int numTabs = 0;
  if (startLine > 0) {
    numTabs = countTabs(newText[startLine - 1]);
    numTabs += tabDifference(newText[startLine - 1]);
  }

  // Add the tabs to the apropriate line
  while (startLine <= endLine) {
    newText[startLine] = newText[startLine].trim();
    if (tabDifference(newText[startLine]) < 0) numTabs += tabDifference(newText[startLine]);

    if (numTabs < 0) numTabs = 0;

    for (i = 0; i < numTabs; i++) {
      newText[startLine] = tab + newText[startLine];
    }

    if (tabDifference(newText[startLine]) > 0) numTabs += tabDifference(newText[startLine]);

    startLine++;
  }

  // Recompile the text appropriately
  text = "";
  for (i = 0; i < newText.length; i++) {
    text = text + newText[i] + "\n";
  }

  return text.trim();
}

void checkOutput(
    String msg,
    OutputKind outputKind,
    ErrorKind errorKind,
    MultilineKind multiKind,
    MultilinePolicy multiPolicy,
    PositionKind posKind,
    XDiagsSource xdiagsSource,
    XDiagsCompact xdiagsCompact,
    CaretKind caretKind,
    SourceLineKind sourceLineKind,
    IndentKind summaryIndent,
    IndentKind detailsIndent,
    IndentKind sourceIndent,
    IndentKind subdiagsIndent) {
  boolean shouldPrintSource =
      posKind == PositionKind.POS
          && xdiagsSource != XDiagsSource.NO_SOURCE
          && (xdiagsSource == XDiagsSource.SOURCE || outputKind == OutputKind.BASIC);
  String errorLine =
      posKind.getOutput(outputKind)
          + errorKind.getOutput(outputKind, summaryIndent, detailsIndent);
  if (xdiagsCompact != XDiagsCompact.COMPACT)
    errorLine +=
        multiKind.getOutput(
            outputKind, errorKind, multiPolicy, summaryIndent, detailsIndent, subdiagsIndent);
  String[] lines = errorLine.split("\n");
  if (xdiagsCompact == XDiagsCompact.COMPACT) {
    errorLine = lines[0];
    lines = new String[] {errorLine};
  }
  if (shouldPrintSource) {
    if (sourceLineKind.isAfterSummary()) {
      String sep = "\n";
      if (lines.length == 1) {
        errorLine += "\n";
        sep = "";
      }
      errorLine =
          errorLine.replaceFirst(
              "\n",
              Matcher.quoteReplacement(
                  xdiagsSource.getOutput(caretKind, sourceIndent, outputKind) + sep));
    } else errorLine += xdiagsSource.getOutput(caretKind, sourceIndent, outputKind);
  }

  if (!msg.equals(errorLine)) {
    printInfo(
        msg,
        outputKind,
        errorKind,
        multiKind,
        multiPolicy,
        posKind,
        xdiagsSource,
        xdiagsCompact,
        caretKind,
        sourceLineKind,
        summaryIndent,
        detailsIndent,
        sourceIndent,
        subdiagsIndent,
        errorLine);
    nerrors++;
  }
}
